import classes from './StartingPageContent.module.css';
import backgroundImage from '../../OIP.jpg'; // Import the image

const StartingPageContent = () => {
  const backgroundStyle = {
    backgroundImage: `url(${backgroundImage})`,
    backgroundSize: 'cover', // Use the imported image as the background
     // Adjust this to control how the image covers the background
  };
  return (
    <section className={classes.starting} style={backgroundStyle}>
      <h1>Welcome on Board!</h1>
    </section>
  );
};

export default StartingPageContent;
